import React, { Component } from 'react'
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';

const mapStyles = {
    width: '50%',
    height: '50%',
    borderColor: "red",
    border: "50px", 
  };


  class MapContainer extends Component {
    state = {
      beaches:[{lat: 40.5726046,
      lng: -73.9787857},
      {lat: 40.5721302,
        lng: -73.9793298
      },
      {lat: 40.5656961,
        lng: -73.86996309999999
      },  
      ]
    }

    displayMarkers = () => {
      return this.state.stores.map((store, index) => {
        return <Marker key={index} id={index} position={{
         lat: store.latitude,
         lng: store.longitude
       }}
       onClick={() => console.log("You clicked me!")} />
      })
    }


    render() {
        return (
            <Map
            google={this.props.google}
            zoom={11}
            style={mapStyles}
            initialCenter={{ lat: 40.5884, lng: -73.6579}}>
            <Marker position={{ lat: 40.5862, lng: -73.6557}} />
            </Map>
        )
    }
}

export default GoogleApiWrapper({
    apiKey: 'AIzaSyCrN9OLFD2SSP9_lYIqcGINzsOJ1iAJ7fM'
  })(MapContainer);
